Donnybrook definition, an inordinately wild fight or contentious dispute; brawl; 
free-for-all. See more. ... Expand. Also called Donnybrook Fair. Origin of ... brawl. 
Word Origin. C19: after Donnybrook Fair, an annual event until 1855 near Dublin.

fair that was held once a year at Donnybrook (County Dublin, Ireland) until 1855; 
wild brawl, fierce fight ... It has given its name to an Irish jig, an upmarket 
supermarket chain, a broadsheet ballad, and is a slang term for a brawl or riot.
